import React from "react";
import "../../../Styles/Pages/Cart/CartProduct.scss";
import cartItem1 from "../../../Assets/cartItem1.webp";
import device from "../../../Assets/svg/device.svg";
import windows from "../../../Assets/svg/windows.svg";
import apple from "../../../Assets/svg/apple.svg";

function CartProduct() {
  return (
    <div className='cartProduct'>
      <div className='cartImg_details'>
        <img src={cartItem1} alt='' />
        <div>
          <h4>War Arena: Titan Wars</h4>
          <p>Game</p>
          <h3>Action</h3>
          <span>EVERYOUNE 13+</span>
          <div className='devices'>
            <img src={device} alt='' />
            <img src={windows} alt='' />
            <img src={apple} alt='' />
          </div>
        </div>
      </div>
    </div>
  );
}

export default CartProduct;
